class Sign extends React.Component{
    constructor(sign){
        super()
        this.sign = sign;
    }

    get sign(){
        return this.sign;
    }

    set sign(sn){
        this.sign = sn;
    }
}

const sn = new Sign('Ussadernsame');

export default function Change(){
    return 'asd';
}
